import itertools 

class Solution(object):
    def jump(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        #near, far, step = 0, 1, 0
        #while far < len(nums):
        #    nfar = max( i + j for i, j in zip( range(near, far), nums[near:far] ) ) + 1
        #    near, far, step = far, nfar, step + 1
        #return step

        nums = [x for x in nums if x is not None]
        size = len(nums)
        if size in [0,1]:
            return size
        maxStep = max(nums[:-1])
        index = nums.index(maxStep)
        cnt = 1
        if index + maxStep < size - 1:
            cnt += self.jump(nums[index + maxStep:])
        if index != 0:
            cnt += self.jump(nums[:index])
            pass
        return cnt

print(Solution().jump([2,3,1,1,4]))
